    const [minDate, setMinDate] = useState();
    const [maxDate, setMaxDate] = useState();
    return(
        <div>
            <form>
                <label>거래기간</label>
                <input type="date" value={minDate} max={today}/><span className="mx-1"> ~ 
                </span><input type="date" value={maxDate} max={today}/>


            </form>
        </div>
    );
}

export default PayHistory;
